import React from 'react';
import AppLayout from '../Components/AppLayout';
import Head from "next/head"
const Profile = () => {
    return (
        <>
        <Head>
            <title>내 프로필 | SkkuBird</title>
        </Head>
        <AppLayout>
            프로필페이지
        </AppLayout>
        </>
    );
};

export default Profile;
